import React from "react";
import "./dman.scss";
const Dman = () => {
  return (
    <>
      <div className="dman-container">
        <div className="block">
          <h1>Name</h1>
        </div>
        <div className="block">
          <h3>Email</h3>
        </div>
        <div className="block">
          <h4>Status</h4>
        </div>
        <div className="block">
          <h5>completed Dalivery:</h5>
        </div>
      </div>
    </>
  );
};

export default Dman;
